const WOLF_SW_CACHE="wolf-shell-v2",WOLF_SW_OFFLINE_PAGE="/no-connection.html",WOLF_SW_PRECACHE=[WOLF_SW_OFFLINE_PAGE];self.addEventListener("install",e=>{e.waitUntil(caches.open(WOLF_SW_CACHE).then(t=>t.addAll(WOLF_SW_PRECACHE)).then(()=>self.skipWaiting()))}),self.addEventListener("activate",e=>{e.waitUntil(caches.keys().then(t=>Promise.all(t.filter(a=>a!==WOLF_SW_CACHE).map(a=>caches.delete(a)))).then(()=>self.clients.claim()))}),self.addEventListener("fetch",e=>{e.request.mode==="navigate"&&e.respondWith(fetch(e.request).catch(async()=>(await caches.open(WOLF_SW_CACHE)).match(WOLF_SW_OFFLINE_PAGE)))}),self.addEventListener("message",e=>{e.data&&e.data.type==="SKIP_WAITING"&&self.skipWaiting()});
